interface IPersonProps {
    name:string;
    age:number;
    email:string;
}

export const Person=({name,age,email}: IPersonProps)=>{
  return (
    <div>
      <h1>{props.name}</h1>
      <h1>{props.age}</h1>
      <h1>{props.email}</h1>
    </div>
  );
}
